} else {
    $bm_rt = value;
}

d.x:
var $bm_rt;
var txt, lineLength, i;
text.sourceText.substr(0, 100);
txt = value;
$bm_rt = lineLength = 16;
if (thisLayer.text.sourceText.length >= lineLength) {
    for (i = lineLength; i > 0; i--)
        if (txt[i] == ' ') {
            break;
        }
    if (i > 0)
        $bm_rt = sum(sum(txt.substr(0, i), '\r'), txt.substr(sum(i, 1)));
    else {
        $bm_rt = sum(sum(txt.substring(0, lineLength), '\r'), txt.substring(sum(lineLength, 1), 999));
    }
} else {
    $bm_rt = txt;
}

