if (thisComp.layer(controleur).effect('IK Orientation')(1) == 1) {
    cw = true;
} else {
    cw = false;
}
function getWorldPos(theLayerName) {
    var L;
    L = thisComp.layer(theLayerName);
    return L.toWorld(L.anchorPoint);
}
function oriente(a, b, P) {
    return sub(mul(sub(b[0], a[0]), sub(P[1], a[1])), mul(sub(P[0], a[0]), sub(b[1], a[1])));
}
A = getWorldPos(boneracine);
B = getWorldPos(bonebout);
C = getWorldPos(zero);
E = getWorldPos(controleur);
a = length(B, C);
b = length(E, A);
c = length(A, B);
x = div(sub(sum(mul(b, b), mul(c, c)), mul(a, a)), mul(2, b));
